.error-page--wrapper-main {
    background-color: #f4f5f6;
    position: relative;
}
.error-page---image {
    background-image: linear-gradient(rgba(0, 0, 0, 0.5) 0%, rgba(0, 0, 0, 0) 49.48%, rgba(0, 0, 0, 0.5) 100%), url(error_bg_image.png);
}
.error-page--wrapper-main .error-page---image {
    align-items: center;
    background-position: 50%;
    background-repeat: no-repeat;
    background-size: cover;
    display: flex;
    flex-direction: row;
    gap: 0;
    height: 1000px;
    isolation: isolate;
    justify-content: center;
    position: relative;
    width: 100%;
    z-index: 0;
}
.error-page--wrapper-main .error-page--content-wrapper {
    align-items: center;
    background: #fff;
    border-radius: 16px;
    box-shadow: 0 16px 32px rgba(0, 0, 0, .05);
    display: flex;
    flex-direction: column;
    gap: 2.5rem;
    max-width: 600px;
    padding: 2.125rem 6.5rem;
    width: 56.07%;
    z-index: 1;
}
.error-page--wrapper-main .error-page--content {
    align-items: center;
    display: flex;
    flex-direction: column;
    gap: 0;
    justify-content: center;
}
.error-page--wrapper-main .error-page--info-block {
    align-items: center;
    display: flex;
    flex-direction: column;
    gap: 0;
    justify-content: center;
    text-align: center;
}
.error-page--wrapper-main .custom-heading--h5.heading--light {
    color: #9c3e0c;
    font-size: 14px;
    line-height: 150%;
}
.error-page--wrapper-main .custom-heading--h5 {
    letter-spacing: 0.1em;
    text-transform: uppercase;
    font-family: "Roboto", sans-serif;
}
.error-page--wrapper-main .error-page--button-wrapper {
    display: flex;
    justify-content: center;
    padding: 0;
    width: 100%;
}
.error-page--wrapper-main a {
    color: inherit !important;
    text-decoration: underline !important;
}
.custom-heading--h1 {
    font-size: 2.5rem;
    font-weight: 400;
    letter-spacing: 0;
    line-height: 125%;
    text-transform: none;
    margin-top: 0 !important;
    margin-bottom: 0 !important;
    font-family: "Tenor Sans", sans-serif;
}
.custom-text--regular {
    font-family: "Tenor Sans", sans-serif !important;
    font-size: 1rem;
    letter-spacing: 0;
    line-height: 150%;
    text-decoration: none;
    font-weight: 400;
}
.information-block-container .info-actions {
    align-items: center;
    display: flex;
    flex-direction: row;
    gap: 0.5rem;
}
.information-block-container p {
    color: #222;
    margin: 1.5rem 0;
}
.custom-button--primary, .custom-button--primaryChevron {
    background: #26828e;
    border: 0;
    border-radius: 3em !important;
    color: #fff;
    cursor: pointer !important;
    display: inline-block;
    font-family: "Roboto", sans-serif;
    font-weight: 700;
}
.custom-button--medium {
    font-size: 0.8rem;
    height: 2.5rem;
    padding: 0 1.5rem;
}
.custom-button--primary:hover, .custom-button--primaryChevron:hover {
    background-color: #30a6b5;
}
.error-page-text-footer {
    bottom: 0;
    left: 0;
    position: absolute;
    background-color: #141312;
    opacity: 0.7;
    color: #d4d2cf;
    width: 25%;
    font-size: 12px;
    padding: 0.5rem 1.5rem;
    border-top-right-radius: 0.5rem;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    text-align: center;
}
.error-page-text-footer-content {
    text-decoration-line: none !important;
    font-weight: 400;
    font-family: "Tenor Sans", sans-serif;
}
@media screen and (max-width: 768px) {
    .error-page--wrapper-main .error-page--content-wrapper {
        align-items: center;
        display: flex;
        flex-direction: column;
        gap: 0.5rem;
        padding: 2.125rem 1.1875rem;
        width: 98%;
   }
    .error-page--wrapper-main .custom-heading--h1 {
        font-size: 2.25rem;
   }
}

